import Banner from "../components/ShopPage/Banner";
import History from "../components/HistoryPage/History";
//---------------------component--------------------------
function HistoryPage() {
  //----------------------------
  return (
    <>
      <Banner page="HISTORY"></Banner>
      <History></History>
    </>
  );
}
export default HistoryPage;
